");\n		return false;\n	} else if(document.getElementById(\'sus_login_password\').value == \'\' && document.getElementById(\'nuretyped\').value == \'\') {\n		alert(\"\'New Password\' and \'Retype New Password\' do not match..\");\n		return false;\n	}\n	return true;\n}','',0,0,'0000-00-00 00:00:00','','0000-00-00 00:00:00','','0000-00-00 00:00:00','','1'),('1472e8ca60dec1','','ima','Images','SELECT * FROM zzzsys_file ORDER BY sfi_group, sfi_code','zzzsys_file','zzzsys_file_id',900,0,'SELECT \'#sfi_code#\'','1','1','1','','','','Add Image','','','','','','','','','','','','','','','','$J           = json_decode(\'#FILES#\');\n\nif($J[0]->name == \'\'){return;}\n\n$dt          = new DateTime();\n$date        = $dt->format(\'Y-m-d H:i:s\');\n\n$name        = $J[0]->name;\n$type        = $J[0]->type;\n$size        = $J[0]->size;\n\n$contents    = file_get_contents(\'tmp/\' . $J[0]->name);\n$contents    = addslashes($contents);\n\n$s           = \"\nUPDATE zzzsys_file \nSET \nsfi_blob                   = \'$contents\',  \nsfi_name                   = \'$name\',  \nsfi_type                   = \'$type\',  \nsfi_size                   = \'$size\', \nzzzsys_file_log_changed_at = \'$date\'\n\nWHERE zzzsys_file_id       = \'#RECORD_ID#\'\n\";\n\nnuRunQuery($s);\n\nunlink(\'tmp/\' . $J[0]->name);\n','','function captureImageClip() {\n    var htmlContent = document.getElementById(\'display_image_clip_textarea\').value;\n    window.prompt (\"Copy to clipboard: Ctrl+C, Enter\", htmlContent);\n}\n\nfunction nuLoadEdit() {\n    nuFORM.FILES = null;\n}\n','',0,0,'0000-00-00 00:00:00','','2014-01-17 13:36:17','globeadmin','2014-01-17 13:36:17','globeadmin','1'),('15023030aec83b','','tra','Translation','SELECT * FROM zzzsys_translate \r\nORDER BY trl_language, trl_english','zzzsys_translate','zzzsys_translate_id',900,0,'','1','1','1','1','0','1','','','','','','','','','','','','','','','','','','','','',0,0,'0000-00-00 00:00:00','','0000-00-00 00:00:00','','0000-00-00 00:00:00','','1')