ULL,NULL,NULL,NULL,'',NULL,NULL,'','$seconds = 0#deb_delete#;\n\nnuDebug($seconds);',NULL,NULL,NULL,0,0,'0000-00-00 00:00:00','','2014-01-10 13:05:22','globeadmin','2014-01-10 13:05:23','globeadmin',NULL),('5269ae8512ebfd3','','allrep','All Reports','SELECT * FROM zzzsys_report','zzzsys_report','zzzsys_report_id',900,0,'','1','1','1','1','','','','','','','','','','','','','','','','','','','','','','',0,0,'2013-10-25 10:04:29','globeadmin','2013-10-25 10:04:29','globeadmin','2013-10-31 07:58:16','globeadmin',NULL),('nuform','','for','nuBuilder Form','SELECT * FROM zzzsys_form\nORDER BY sfo_name','zzzsys_form','zzzsys_form_id',1000,0,'','1','1','1','1','','','','','','','','','','SELECT 1','','','','','','','','','','','   \n    $(document).ready(function() {\n    \n    if(nuFORM.tip == \'Edit\'){\n\n        $(\"[id^=\'nuCode_\']\").css(\'border-style\',     \'solid\');\n        $(\"[id^=\'nuCode_\']\").css(\'border-width\',     \'1px\');\n\n        $(\"textarea[id*=\'display_condition\']\").css(\'background-color\', \'#D2F4D5\');\n        $(\"textarea[id*=\'display_condition\']\").css(\'font-family\', \'Courier New\');\n        $(\"textarea[id*=\'display_condition\']\").css(\'font-size\', \'14px\');\n        $(\"textarea[id*=\'display_condition\']\").attr( \'wrap\', \'off\');\n\n        $(\"#sfo_breadcrumb\").css(\'background-color\', \'#D2F4D5\');\n        $(\"#sfo_breadcrumb\").css(\'font-family\', \'Courier New\');\n        $(\"#sfo_breadcrumb\").css(\'font-size\', \'14px\');\n        $(\"#sfo_breadcrumb\").attr( \'wrap\', \'off\');\n\n        $(\"textarea[id*=\'sql\']\").css(\'background-color\', \'#D2F4D5\');\n        $(\"textarea[id*=\'sql\']\").css(\'font-family\', \'Courier New\');\n        $(\"textarea[id*=\'sql\']\").css(\'font-size\', \'14px\');\n        $(\"textarea[id*=\'sql\']\").attr( \'wrap\', \'off\');\n\n        $(\"textarea[id*=\'sfo_custom_code_run\']\").css(\'background-color\', \'#FFE8CA\');\n        $(\"textarea[id*=\'sfo_custom_code_run\']\").css(\'font-family\', \'Courier New\');\n        $(\"textarea[id*=\'sfo_custom_code_run\']\").css(\'font-size\', \'14px\');\n        $(\"textarea[id*=\'sfo_custom_code_run\']\").attr( \'wrap\', \'off\');\n\n        $(\"textarea[id*=\'javascript\']\").css(\'background-color\', \'#CAE1FF\');\n        $(\"textarea[id*=\'javascript\']\").css(\'font-family\', \'Courier New\');\n        $(\"textarea[id*=\'javascript\']\").css(\'font-size\', \'14px\');\n        $(\"textarea[id*=\'javascript\']\").attr( \'wrap\', \'off\');\n\n        $(\"textarea[id*=\'sob_html_code\']\").css(\'background-color\', \'#EEE4EC\');\n        $(\"textarea[id*=\'sob_html_code\']\").css(\'font-family\', \'Courier New\');\n        $(\"textarea[id*=\'sob_html_code\']\").css(\'font-size\', \'14px\');\n        $(\"textarea[id*=\'sob_html_code\']\").attr( \'wrap\', \'off\');\n        $(\"[id^=\'nu_holder_sfo_custom_code_run_\']\").css(\'visibility\', \'hidden\');\n    }\n\n    });\n\n    function nuShowCode(pThis){\n\n        $(\"[id^=\'sfo_custom_code_run_\']\").css(\'width\',      \'0px\');\n        $(\"[id^=\'sfo_custom_code_run_\']\").css(\'height\',     \'0px\');\n        $(\"[id^=\'sfo_custom_code_run_\']\").css(\'visibility\', \'hidden\');\n        $(\"[id^=\'sfo_custom_code_run_\']\").css(\'visibility\', \'hidden\');\n        $(\"[id^=\'nu_holder_sfo_custom_code_run_\']\").css(\'visibility\', \'hidden\');\n        $(\"[id^=\'nuCode_\']\").addClass(\'nuGradient\');\n        $(\"[id^=\'nuCode_\']\").removeClass(\'nuGradientLight\');\n\n        $(\"#sfo_custom_code_run_\"+pThis.id.substr(7)).css(\'width\',      \'900px\');\n        $(\"#sfo_custom_code_run_\"+pThis.id.substr(7)).css(\'height\',     \'400px\');\n        $(\"#sfo_custom_code_run_\"+pThis.id.substr(7)).css(\'visibility\', \'visible\');\n        $(\"#nu_holder_sfo_custom_code_run_\"+pThis.id.substr(7)).css(\'visibility\', \'visible\');\n        $(\"#\"+pThis.id).removeClass(\'nuGradient\');\n        $(\"#\"+pThis.id).addClass(\'nuGradientLight\');\n    }   \n\n    function nuPopulateSort(t){\n\n        var p = \'#\' + $(\'#\'+t.id).attr(\'data-prefix\') + \'sbr_sort\';\n        if($(p).val() == \'\'){\n        $(p).val(t.value)\n        \n    }\n\n    }','',0,0,'0000-00-00 00:00:00','','2013-10-31 07:45:37','globeadmin','2014-01-09 17:09:29','globeadmin','1'),('nuindex','','ind','Index','SELECT * FROM zzzsys_form','zzzsys_form','zzzsys_form_id',900,0,'','0','0','0','0','','','','','','','','','','','','','','','','','','','','','','',0,0,'0000-00-00 00:00:00','','0000-00-00 00:00:00','','0000-00-00 00:00:00','','1'),('nuobject','','obj','nuBuilder Objects','SELECT form_name, zzzsys_object.* \nFROM zzzsys_object\nINNER JOIN #TABLE_ID# ON zzzsys_object.sob_zzzsys_form_id = #TABLE_ID#.form_id \nORDER BY form_name, sob_all_tab_number, sob_all_column_number, sob_all_order_number \n','zzzsys_object','zzzsys_object_id',1000,0,'','1','1','1','1','','1','','','','','','','','','','','','','\n$f = \'#sob_zzzsys_form_id#\';\n$n = \'#sob_all_name#\';\n$s = \"SELECT zzzsys_object_id, sob_all_type, sob_all_name FROM zzzsys_object WHERE sob_zzzsys_form_id = ? AND sob_all_name = ? \";\n$t = nuRunQuery($s, array($f, $n));\n$r = db_fetch_object($t);\n\nif($r->zzzsys_object_id != \'\'){\n\n        $MESS = \"There is already an Object of type \'$r->sob_all_type\' on this Form with the Field Name $r->sob_all_name\"; \n//        nuDisplayError($MESS);\n        \n}\n\nif(\'#sob_all_type#\' == \'iframe\'){\n\n    if(\'#sob_iframe_zzzsys_php_id#\' == \'\' and \'#sob_iframe_zzzsys_report_id#\' == \'\'){\n\n        $MESS = \"Both PHP to Run and Report to Run cannot be left blank..  (TAB : iFrame)\"; \n        nuDisplayError($MESS);\n\n    }\n\n}\n\nif(\'#sob_all_type#\' == \'browse\'){\n    if(\'#sob_browse_zzzsys_form_id#\' == \'\'){\n\n        $MESS = \"Browse cannot be left blank..  (TAB : Browse)\"; \n        nuDisplayError($MESS);\n\n    }\n\n    if(\'#sob_all_width#\' == \'\' or \'#sob_all_width#\' == \'0\'){\n\n        $MESS = \"Width must be over zero..  (TAB : All)\"; \n        nuDisplayError($MESS);\n\n    }\n    \n}\n\n\nif(\'#sob_all_type#\' == \'button\'){\n\n    if(\'#sob_all_width#\' == \'\' or \'#sob_all_width#\' == \'0\'){\n\n        $MESS = \"Width must be over zero..  (TAB : All)\"; \n        nuDisplayError($MESS);\n\n    }\n\n}\n\nif(\'#sob_all_type#\' == \'display\'){\n\n    if(\'#sob_all_width#\' == \'\' or \'#sob_all_width#\' == \'0\'){\n\n        $MESS = \"Width must be over zero..  (TAB : All)\"; \n        nuDisplayError($MESS);\n\n    }\n\n    if(\'#sob_display_sql#\' == \'\'){\n\n        $MESS = \"SQL cannot be left blank..  (TAB : Display)\"; \n        nuDisplayError($MESS);\n\n    }\n\n}\n\nif(\'#sob_all_type#\' == \'dropdown\'){\n\n    if(\'#sob_all_width#\' == \'\' or \'#sob_all_width#\' == \'0\'){\n\n        $MESS = \"Width must be over zero..  (TAB : All)\"; \n        nuDisplayError($MESS);\n\n    }\n    if(\'#sob_dropdown_sql#\' == \'\'){\n\n        $MESS = \"SQL cannot be left blank..  (TAB : Dropdown)\"; \n        nuDisplayError($MESS);\n\n    }\n}\n\nif(\'#sob_all_type#\' == \'html\'){\n\n    if(\'#sob_all_width#\' == \'\' or \'#sob_all_width#\' == \'0\'){\n\n        $MESS = \"Width must be over zero..  (TAB : All)\"; \n        nuDisplayError($MESS);\n\n    }\n\n\n    if(\'#sob_html_code#\' == \'\'){\n\n        $MESS = \"SQL cannot be left blank..  (TAB : HTML)\"; \n        nuDisplayError($MESS);\n\n    }\n\n}\n\n\nif(\'#sob_all_type#\' == \'listbox\'){\n\n    if(\'#sob_all_width#\' == \'\' or \'#sob_all_width#\' == \'0\'){\n\n        $MESS = \"Width must be over zero..  (TAB : All)\"; \n        nuDisplayError($MESS);\n\n    }\n\n    if(\'#sob_listbox_sql#\' == \'\'){\n\n        $MESS = \"SQL cannot be left blank..  (TAB : Listbox)\"; \n        nuDisplayError($MESS);\n\n    }\n\n}\nif(\'#sob_all_type#\' == \'lookup\'){\n\n    if(\'#sob_lookup_id_field#\' == \'\'){\n\n        $MESS = \"ID Field cannot be left blank..  (TAB : Lookup)\"; \n        n