INSERT INTO `zzzsys_setup` VALUES ('1','','NOT USED DELETED THIS FIELD',120,'Australia/Melbourne','','','','','',0,'','','','</script>\r\n\r\n<script>\r\n\r\nfunction nuObjectColors(o){\r\n\r\n    return \'nu_\' + o;\r\n    \r\n}\r\n\r\nfunction nuLoadEditGlobal(){\r\n nuOnLoad();\r\n}\r\n\r\n\r\nfunction nuLoadBrowseGlobal(){\r\n nuOnLoad();\r\n}\r\n\r\nfunction nuOnLoad() {\r\n\r\n    if (window.top === window.self) {\r\n        var logoWidth = 129;\r\n        var logoLeft  = parseInt($(\'#nuActionButtonHolder\').css(\'width\')) - logoWidth - 10;\r\n        if (logoLeft > 500) {\r\n            var im        = document.createElement(\'img\');\r\n            im.setAttribute(\'id\', \'thislogo\');\r\n            im.setAttribute(\'src\', \'nuBuilder-Logo-medium.png\');\r\n            $(\'#nuActionButtonHolder\').append(im);\r\n            $(\'#\' + im.id).css( \'width\', logoWidth + \'px\');\r\n            $(\'#\' + im.id).css( \'height\', \'31px\');\r\n            $(\'#\' + im.id).css( \'left\',  logoLeft  + \'px\');\r\n            $(\'#\' + im.id).css( \'position\', \'absolute\');\r\n            $(\'#\' + im.id).css( \'border-style\', \'none\');\r\n            $(\'#\' + im.id).css( \'z-index\', \'0\');\r\n            $(\'#\' + im.id).css( \'top\', \'0px\');\r\n        }\r\n    } else {\r\n           if ( !window.parent.document.getElementById(\'nuDrag\') ) {\r\n               document.body.style.backgroundColor = \'#EDEDED\';\r\n           }      \r\n    }\r\n}\r\n\r\n</script>\r\n\r\n\r\n<style>\r\n\r\n.nu_browse                   {background-color : #8de2e2}\r\n.nu_button                   {background-color : #98AFC7}\r\n.nu_display                  {background-color : #C7B097}\r\n.nu_dropdown                 {background-color : #7bce98}\r\n.nu_html                     {background-color : #c497a6}\r\n.nu_iframe                   {background-color : #89C35C}\r\n.nu_listbox                  {background-color : #caa5f6}\r\n.nu_lookup                   {background-col